import React from 'react';
import Imagen from './Imagen';

const ListadoImagenes = ({imagen}) => {
    return ( 
        <div className="col-12 p-5 row">
            {imagenes.map(imagens => (
                <Imagen
                    imagen={imagen}
                />
            ))}
        </div>
     );
}

export default ListadoImagenes;
